import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav class='bg-gray-800'>
      <div>
        <div>
          <Link to='/' className=' text-gray-300'>
            Home
          </Link>
          <Link to='/posts' className='text-gray-300'>
            Posts
          </Link>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
